आयोगले आगाम

राहदानी विभागले अब दुई कार्यदिनभित्र राहदानी उपलब्ध गराउने भएको छ ।&amp;nbsp;

कूल तीन लाख ९६ हजार थान राहदानी छपाइ भएर आपूर्ति भइसकेको उल्लेख गर्दै विभागले आवश्यक भएकालाई तत्कालै उपलब्ध गराइने जनाएको छ ।

